import React from 'react';
import pass from './password.png';
import './Login.css';
import {NavLink} from "react-router-dom";

function Login() {
  return (
    <div className="outer">
        <div className="inner">
            <div className="upper">
                <img src={pass} />
                <div className="up"> Pass-Man </div>
            </div>
            <div className="nam">Login</div>
            <div className="nam1">Don't have an account? <NavLink to="/Signup">Click here</NavLink></div>
            <input type="text" className="uname" placeholder="Enter Username" />
            <input type="text" className="pass" placeholder="Enter Password" />
            <button className="but">Login</button>
        </div>
    </div>
  );
};

export default Login;
